'use client'
import { useTheme } from "next-themes";
import { Dock, DockIcon } from "../ui/dock";




export type IconProps = React.HTMLAttributes<SVGElement>;

export function NavBar() {
  const { setTheme, theme } = useTheme()

  return (
    <div className="fixed top-0 left-0 w-full z-[1000]">
      <Dock magnification={70} distance={100}>
        {/* Hero */}
        <DockIcon className="bg-black/10 dark:bg-white/10 p-3" title="Accueil">
          <Icons.hero className="size-full" />
        </DockIcon>
        {/* Projets */}
        <DockIcon className="bg-black/10 dark:bg-white/10 p-3" title="Projets">
          <Icons.project className="size-full" />
        </DockIcon>
        {/* Expérience */}
        <DockIcon className="bg-black/10 dark:bg-white/10 p-3" title="Expériences">
          <Icons.experience className="size-full" />
        </DockIcon>
        {/* CV */}
        <DockIcon className="bg-black/10 dark:bg-white/10 p-3" title="Télécharger mon CV">
          <Icons.cv className="size-full" />
        </DockIcon>
        {/* Theme */}
        <DockIcon className="bg-black/10 dark:bg-white/10 p-3" title="Changer de thème" onClick={() => {
          setTheme(theme === "light" ? "dark" : "light");
        }}>
          <Icons.theme className="size-full" />
        </DockIcon>
      </Dock>
    </div>
  );
}

